const NativeRO = window.ResizeObserver;
window.ResizeObserver = function (callback) {
  const wrapped = entries => {
    try { callback(entries); }
    catch (err) {
      // swallow only the loop completion errors
      if (!err.message.includes('Loop completed with undelivered notifications')) {
        // rethrow anything else
        throw err;
      }
    }
  };
  return new NativeRO(wrapped);
};

// 2) Suppress the typical “Script error.” and “Canceled” messages
window.addEventListener('error', e => {
  const m = e.message || '';
  if (m === 'Script error.' || m.includes('Canceled')) {
    e.preventDefault(); e.stopImmediatePropagation();
  }
});
window.addEventListener('unhandledrejection', e => {
  const m = (e.reason && e.reason.message) || '';
  if (m === 'Script error.' || m.includes('Canceled')) {
    e.preventDefault(); e.stopImmediatePropagation();
  }
});

// 3) Now import and render React (Monaco will come after)
import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';

const container = document.getElementById('root');
const root = createRoot(container);
root.render(<App />);
